          <meta charset="UTF-8">

          <title>Relatório</title>
          
      <style>
        * {
          box-sizing: border-box;
          margin: 0;
          padding: 0;
        }
        
        body {
          font-family: 'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
          font-size: 14px;
          line-height: 1.6;
          color: #374151;
          background: white;
        }
        
        .report-container {
          padding: 20px;
          max-width: 100%;
          min-height: 100vh;
        }
        
        .page-break {
          page-break-before: always;
        }
        
        .avoid-break {
          page-break-inside: avoid;
        }
        
        .table {
          width: 100%;
          border-collapse: collapse;
          margin: 20px 0;
          font-size: 12px;
        }
        
        .table th,
        .table td {
          border: 1px solid #d1d5db;
          padding: 8px 12px;
          text-align: left;
          vertical-align: top;
        }
        
        .table th {
          background-color: #f9fafb;
          font-weight: 600;
          color: #374151;
        }
        
        .table tbody tr:nth-child(even) {
          background-color: #f9fafb;
        }
        
        .chart-container {
          margin: 20px 0;
          text-align: center;
          page-break-inside: avoid;
        }
        
        .chart {
          max-width: 100%;
          height: auto;
        }
        
        .header {
          text-align: center;
          margin-bottom: 30px;
          padding-bottom: 20px;
          border-bottom: 2px solid #3b82f6;
        }
        
        .footer {
          text-align: center;
          margin-top: 30px;
          padding-top: 20px;
          border-top: 1px solid #d1d5db;
          font-size: 12px;
          color: #6b7280;
        }
        
        .text-center { text-align: center; }
        .text-right { text-align: right; }
        .text-left { text-align: left; }
        
        .font-bold { font-weight: 700; }
        .font-semibold { font-weight: 600; }
        .font-normal { font-weight: 400; }
        
        .text-red-500 { color: #ef4444; }
        .text-green-500 { color: #10b981; }
        .text-blue-500 { color: #3b82f6; }
        .text-yellow-500 { color: #f59e0b; }
        .text-gray-500 { color: #6b7280; }
        .text-gray-700 { color: #374151; }
        
        .bg-red-50 { background-color: #fef2f2; }
        .bg-green-50 { background-color: #f0fdf4; }
        .bg-blue-50 { background-color: #eff6ff; }
        .bg-yellow-50 { background-color: #fffbeb; }
        
        .border-red-200 { border-color: #fecaca; }
        .border-green-200 { border-color: #bbf7d0; }
        .border-blue-200 { border-color: #bfdbfe; }
        .border-yellow-200 { border-color: #fde68a; }
        
        .p-2 { padding: 8px; }
        .p-4 { padding: 16px; }
        .p-6 { padding: 24px; }
        
        .m-2 { margin: 8px; }
        .m-4 { margin: 16px; }
        .m-6 { margin: 24px; }
        
        .mb-2 { margin-bottom: 8px; }
        .mb-4 { margin-bottom: 16px; }
        .mb-6 { margin-bottom: 24px; }
        
        .mt-2 { margin-top: 8px; }
        .mt-4 { margin-top: 16px; }
        .mt-6 { margin-top: 24px; }
        
        .text-xs { font-size: 12px; }
        .text-sm { font-size: 14px; }
        .text-base { font-size: 16px; }
        .text-lg { font-size: 18px; }
        .text-xl { font-size: 20px; }
        .text-2xl { font-size: 24px; }
        
        .grid {
          display: grid;
          gap: 16px;
        }
        
        .grid-cols-2 { grid-template-columns: repeat(2, 1fr); }
        .grid-cols-3 { grid-template-columns: repeat(3, 1fr); }
        .grid-cols-4 { grid-template-columns: repeat(4, 1fr); }
        
        @media print {
          .no-print { display: none !important; }
          .page-break { page-break-before: always; }
          .avoid-break { page-break-inside: avoid; }
          
          body {
            print-color-adjust: exact;
            -webkit-print-color-adjust: exact;
          }
        }
        
        /* Estilos específicos para cabeçalho e rodapé */
        @page {
          margin: 20mm 20mm 20mm 20mm;
        }
        
        .pdf-header {
          font-size: 10px;
          color: #6b7280;
          text-align: center;
          width: 100%;
        }
        
        .pdf-footer {
          font-size: 10px;
          color: #6b7280;
          text-align: center;
          width: 100%;
        }
      </style>

      <!DOCTYPE html>

        <head>
          <meta charset="UTF-8">
          <meta name="viewport" content="width=device-width, initial-scale=1.0">
          <title>Relatório</title>
          <style>
            * {
              box-sizing: border-box;
              margin: 0;
              padding: 0;
            }
            
            body {
              font-family: Arial, sans-serif;
              font-size: 14px;
              line-height: 1.4;
              color: #374151;
              background: #f3f4f6; /* Light gray background for preview */
            }
            
            .page-container {
              position: relative;
              width: 210mm;
              min-height: 297mm;
              margin: 0 auto;
              background: white;
              overflow: hidden; /* Ensure elements don't bleed out */
              /* No padding - elements are positioned in absolute page coordinates (matching editor) */
              box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06);
              margin-bottom: 20px;
            }

            .content-area {
              position: relative;
              width: 100%;
              min-height: 257mm;
            }
            
            .editor-element {
              box-sizing: border-box;
            }
            
            .editor-text, .editor-heading {
              overflow-wrap: break-word;
              word-wrap: break-word;
            }
            
            .chart-placeholder {
              display: flex;
              flex-direction: column;
              align-items: center;
              justify-content: center;
              height: 100%;
              border: 2px dashed #cbd5e0;
              border-radius: 8px;
              background: #f7fafc;
              padding: 20px;
              text-align: center;
            }
            
            .text-sm {
              font-size: 12px;
            }
            
            .text-gray-500 {
              color: #6b7280;
            }
            
            @page {
              size: 210mm 297mm;
              margin: 0; /* We handle margins in the container padding */
            }

            @media print {
              body {
                background: white;
              }
              .page-container {
                box-shadow: none;
                margin: 0;
                page-break-after: always;
              }
              .page-container:last-child {
                page-break-after: auto;
              }
            }
          </style>
